<p>        <em>L1</em>- (<em>Lasso</em>),    <span class=MathJax_Preview style=color:inherit></span><span class=MathJax_SVG id=MathJax-Element-51-Frame tabindex=0 role=application aria-label=&quot;upper R squared&quot; haslabel=true style=font-size:100%;display:inline-block><svg xmlns:xlink=http://www.w3.org/1999/xlink class=mjx-svg-math data-semantic-complexity=5.8 width=2.818ex height=2.344ex viewBox=&quot;0 -906.7 1213.4 1009.2&quot; role=img focusable=false style=vertical-align:-0.238ex><g stroke=currentColor fill=currentColor stroke-width=0 transform=&quot;matrix(1 0 0 -1 0 0)&quot;><g class=mjx-svg-mrow><g class=mjx-svg-msup data-semantic-type=superscript data-semantic-role=latinletter data-semantic-id=2 data-semantic-children=0,1 data-semantic-complexity=5.8><g class=mjx-svg-mi data-semantic-type=identifier data-semantic-role=latinletter data-semantic-font=italic data-semantic-id=0 data-semantic-parent=2 data-semantic-complexity=1><use xlink:href=#MJMATHI-52></use></g><g class=mjx-svg-texatom data-semantic-complexity=1 transform=translate(759,362)><g class=mjx-svg-mrow><g class=mjx-svg-mn data-semantic-type=number data-semantic-role=integer data-semantic-font=normal data-semantic-id=1 data-semantic-parent=2 data-semantic-complexity=1><use transform=scale(0.707) xlink:href=#MJMAIN-32></use></g></g></g></g></g></g></svg></span>           <span class=code-blue>train_scores</span>  <span class=code-blue>test_scores</span>:</p>
<div style=&quot;background:#f8f8f8;overflow:auto;width:auto;border:solid #d1d9d7;border-width:.1em;padding:.2em .6em&quot;>
<pre style=margin:0;line-height:125%><span style=color:#888888>#   20    0.001  1</span>
alpha_list <span style=color:#333333>=</span> np<span style=color:#333333>.</span>linspace(<span style=color:#6600ee;font-weight:bold>0.001</span>, <span style=color:#0000dd;font-weight:bold>1</span>, <span style=color:#0000dd;font-weight:bold>20</span>)
<span style=color:#888888>#  ,      </span>
train_scores <span style=color:#333333>=</span> []
test_scores <span style=color:#333333>=</span> []
<span style=color:#008800;font-weight:bold>for</span> alpha <span style=color:#000000;font-weight:bold>in</span> alpha_list:
    <span style=color:#888888>#      L1-</span>
    lasso_lr_poly <span style=color:#333333>=</span> linear_model<span style=color:#333333>.</span>Lasso(alpha<span style=color:#333333>=</span>alpha, max_iter<span style=color:#333333>=</span><span style=color:#0000dd;font-weight:bold>10000</span>)
    <span style=color:#888888># </span>
    lasso_lr_poly<span style=color:#333333>.</span>fit(X_train_scaled_poly, y_train)
    <span style=color:#888888>#    </span>
    y_train_predict_poly <span style=color:#333333>=</span> lasso_lr_poly<span style=color:#333333>.</span>predict(X_train_scaled_poly)
    <span style=color:#888888>#    </span>
    y_test_predict_poly <span style=color:#333333>=</span> lasso_lr_poly<span style=color:#333333>.</span>predict(X_test_scaled_poly)
    <span style=color:#888888>#          </span>
    train_scores<span style=color:#333333>.</span>append(metrics<span style=color:#333333>.</span>r2_score(y_train, y_train_predict_poly))
    test_scores<span style=color:#333333>.</span>append(metrics<span style=color:#333333>.</span>r2_score(y_test, y_test_predict_poly))
</pre>
